class Solution {
  int minimumOperations(String num) {
    int ans = num.length;
    List<int> lastPos = List.filled(10, -1);
    for (int i = num.length - 1; i >= 0; --i) {
      int digit = num.codeUnitAt(i) - '0'.codeUnitAt(0);
      if (digit == 0 || digit == 5) {
        if (lastPos[0] != -1) {
          ans = min(ans, lastPos[0] - i - 1);
        }
        if (lastPos[5] != -1 && digit == 5) {
          ans = min(ans, lastPos[5] - i - 1);
        }
      } else if (digit == 2 || digit == 7) {
        if (lastPos[5] != -1) {
          ans = min(ans, lastPos[5] - i - 1);
        }
      }
      lastPos[digit] = i;
    }
    return ans == num.length ? num.length : ans;
  }

  int min(int a, int b) => a < b ? a : b;
}
